import React from "react";
import Chef from "../../interfaces/Chef";
import './HomePage.scss';

interface ChefProps {
  chefs: Chef[];
}

const ChefItem: React.FC<Chef> = ({key, chefName, chefImage, chefDescription, restaurantName, restaurantImage}: Chef) => {
  return (
    <div className="data-item">
      <img src={chefImage} alt="img"></img>
      <p>{chefName}</p>
      <p>{chefDescription}</p>
      <img src={restaurantImage} alt="img"></img>
      <p>{restaurantName} </p>
    </div>
  );
};


const Chefs: React.FC<ChefProps> = ({
  chefs,
}: ChefProps) => {
  return (
    <div className="data-container">
      {chefs.map((chef) => {
        if(chef.chefName)
        return (
          <ChefItem
            key={chef.key}
            chefName={chef.chefName}
            chefImage={chef.chefImage}
            chefDescription={chef.chefDescription}
            restaurantName={chef.restaurantName}
            restaurantImage={chef.restaurantImage}
          ></ChefItem>
        );
      })}
    </div>
  );
};

export default Chefs;
